import React from "react";
import "./styles/carouselHome.css";
import ImgBanner from "./../../../../assets/images/1.jpg";

export default function Banner1() {

  return (
    <div>
      <div>
        <img
          src={ImgBanner}
          alt="banner"
          width="100%"
        />
      </div>
    </div>
  );
    }
